  fullName: SuperOffice.CRM.Lists.ExternallyPopulatedList
  type: Class
  assemblies:
  - SoDataBase
  namespace: SuperOffice.CRM.Lists
  summary: >-
    A simple, flat list of literal values, populated from some external source via a function passed in to constructor.

    This provider does not carry the attribute and is not registered for a particular list; it is 

    intended to be returned by some other, presumably dynamic, mechanism.
  remarks: >-
    Constructor saves function for later.

    Function is executed during Construct call.

    This keeps slow list population away from the constructor, which keeps locking short.

    Avoids blocking the factory.
